css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix("http://stackoverflow.com/") {
    div.topbar, 
    div#header,
    div#footer,
    div.vote,
    div#herobox-mini,
    div#sidebar,
    div#feed-link,
    h2.bottom-notice,
    form#post-form {
      display: none;
    }

    body {
        font-size: 13pt;
    }

    span, code {
        font-size: 11pt;
    }
}
